import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { jwtDecode } from 'jwt-decode';

import Navbar from './components/Navbar';
import Login from './components/Login';
import Signup from './components/Signup';
import ForgotPassword from './components/ForgotPassword';
import ResetPassword from './components/ResetPassword';
import ItemList from './components/ItemList';
import MapView from './components/MapView';
import Messages from './components/Messages';
import EcoPoints from './components/EcoPoints';
import Dashboard from './components/Dashboard';
import ProtectedRoute from './components/ProtectedRoute';
import MessageInbox from './components/MessageInbox';
import AdminDashboard from './components/AdminDashboard'; // Make sure this exists
import 'leaflet/dist/leaflet.css';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [currentUserId, setCurrentUserId] = useState(null);
  const [isAdmin, setIsAdmin] = useState(false);

  useEffect(() => {
    const token = localStorage.getItem('token');

    if (token) {
      if (token === 'admin-token') {
        setIsAuthenticated(true);
        setIsAdmin(true);
      } else if (token.split('.').length === 3) {
        try {
          const decoded = jwtDecode(token);
          setIsAuthenticated(true);
          setCurrentUserId(decoded.id);
        } catch (err) {
          console.error('Invalid token:', err);
          setIsAuthenticated(false);
        }
      } else {
        setIsAuthenticated(false);
      }
    }
  }, []);

  return (
    <Router>
      {isAuthenticated && <Navbar />}
      <Routes>
        {/* Public Routes */}
        <Route
          path="/"
          element={isAuthenticated ? <Navigate to="/Dashboard" /> : <Login />}
        />
        <Route
          path="/login"
          element={isAuthenticated ? <Navigate to="/Dashboard" /> : <Login />}
        />
        <Route
          path="/signup"
          element={isAuthenticated ? <Navigate to="/Dashboard" /> : <Signup />}
        />
        <Route
          path="/forgot-password"
          element={isAuthenticated ? <Navigate to="/Dashboard" /> : <ForgotPassword />}
        />
        <Route
          path="/reset-password"
          element={isAuthenticated ? <Navigate to="/Dashboard" /> : <ResetPassword />}
        />

        {/* Admin Route */}
        <Route
          path="/AdminDashboard"
          element={
            isAdmin ? <AdminDashboard /> : <Navigate to="/login" />
          }
        />

        {/* Protected Routes */}
        <Route
          path="/Dashboard"
          element={
            <ProtectedRoute isAuthenticated={isAuthenticated}>
              <Dashboard />
            </ProtectedRoute>
          }
        />
        <Route
          path="/items"
          element={
            <ProtectedRoute isAuthenticated={isAuthenticated}>
              <ItemList />
            </ProtectedRoute>
          }
        />
        <Route
          path="/map"
          element={
            <ProtectedRoute isAuthenticated={isAuthenticated}>
              <MapView />
            </ProtectedRoute>
          }
        />
        <Route
          path="/messages"
          element={
            <ProtectedRoute isAuthenticated={isAuthenticated}>
              <MessageInbox currentUserId={currentUserId} />
            </ProtectedRoute>
          }
        />
        <Route
          path="/messages/:itemId/:receiverId"
          element={
            <ProtectedRoute isAuthenticated={isAuthenticated}>
              <Messages currentUserId={currentUserId} />
            </ProtectedRoute>
          }
        />
        <Route
          path="/eco-points"
          element={
            <ProtectedRoute isAuthenticated={isAuthenticated}>
              <EcoPoints />
            </ProtectedRoute>
          }
        />

        {/* Catch-all route */}
        <Route path="*" element={<Navigate to="/" />} />
      </Routes>
    </Router>
  );
}

export default App;
